import { Menu,Button } from "semantic-ui-react";

export default function campaings() {
  

  return (
    <div >
      <Button.Group inverted size="huge" widths='3' >
    <Button color='white'>One</Button>
    <Button  basic inverted color='purple'>Two</Button>
    <Button>Three</Button>
  </Button.Group>
    </div>
  );
}
